import os
from bs4 import BeautifulSoup

# Start directory for full scan (internal storage)
start_dir = &quot;/storage/emulated/0&quot;

# Store results
all_messages = []

def extract_chat_from_html(path):
    try:
        print(f&quot;Opening file: {path}&quot;)  # Debugging line to show file being opened
        with open(path, &quot;r&quot;, encoding=&quot;utf-8&quot;) as f:
            soup = BeautifulSoup(f, &quot;html.parser&quot;)
            messages = []

            # Try finding all message blocks
            for div in soup.find_all(&quot;div&quot;):
                text = div.get_text(strip=True)
                if text:
                    print(f&quot;Found text: {text}&quot;)  # Debugging line to show the text found
                    messages.append(text)

            if messages:
                all_messages.append((path, messages[:10]))  # Save only first 10 messages for brevity
    except Exception as e:
        print(f&quot;Error reading {path}: {e}&quot;)  # Print errors if file is not readable

# Walk through storage
for root, dirs, files in os.walk(start_dir):
    for file in files:
        if file.endswith(&quot;.html&quot;):
            full_path = os.path.join(root, file)
            extract_chat_from_html(full_path)

# Print results
if not all_messages:
    print(&quot;No HTML conversations found.&quot;)
else:
    for path, messages in all_messages:
        print(f&quot;\n--- From {path} ---&quot;)
        for msg in messages:
            print(f&quot;- {msg}&quot;)
